traefik_certificates: []
traefik_debug: false
traefik_dir: /etc/traefik
traefik_group: www-data
traefik_log_level: ERROR
traefik_network: traefik
traefik_network_driver: bridge
traefik_network_attachable: false
traefik_state: started
traefik_user: www-data
traefik_volumes: []
traefik_enable_web: false
traefik_https_redirect: true
traefik_acme_on_demand: false
traefik_acme_domains: []
traefik_acme_challenge: 'tls'
traefik_acme_dns_provider: ''
traefik_acme_dns_delay: 0
